import './App.css';
import {AppBar, Button, IconButton, Stack, Toolbar, Tooltip, Typography} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

import Nav from './components/Nav/Nav';
import { Box, Container } from '@mui/system';

function App() {
  return (
    // <Routes>
    <div className="App">
      {/* <Container sx={{border: '1px solid red', display: 'column', justifyContent: 'center', alignItems: 'center'}}>
        <Box>
      <Typography variant='h3'>Hello From App</Typography>
      </Box>
      <Stack direction='row' spacing={2}>
      <Button variant='contained' href='/navbar'>Navbar</Button>
      <Button variant='outlined' href='/navbar'>Expenses</Button>
      </Stack>
      </Container> */}
      {/* <Link to={'/navbar'}>Navbar</Link>
      <Link to={'/expense'}>Expense</Link> */}
      {/* <Route path='/navbar' component={<Nav />} /> */}
      {/* <Nav /> */}

      <Box>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h5" sx={{ flexGrow: 1 }}>
            Expense Tracker
          </Typography>
          <Button href='/expenses' color="inherit">Expenses</Button>
          <Button href='/login' color="inherit">Login</Button>
          <Tooltip>
            <IconButton>
              <AccountCircleIcon sx={{color: 'white'}} />
            </IconButton>
          </Tooltip>
        </Toolbar>
      </AppBar>
    </Box>


    </div>
    // </Routes>
  );
}

export default App;
